import './App.css';
import React from 'react';
import {StyleSheet, View} from 'react-native';

const Flex = () => {
  return (
    <View
      style={[
        styles.row,
        {
          // Try setting `flexDirection` to `"row"`.
          flexDirection: 'row',
        },
      ]}>
      <View style={[
        styles.column,
        {flexDirection: 'column', backgroundColor: 'red'}
        ]} />
        text
      <View style={[
        {flex: 2, backgroundColor: 'darkorange'}
        ]} />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
  },
  column: {
    flex: 1,
  }
});

export default Flex;
